import React from 'react'
import './NestedMapping.css'


const Users = [{
    name: "mh akash",
    age: 30,
    phone: [{
      "home": "019893"
    }, {
      "office": "558885"
    }]
  },
  {
    name: "ria",
    age: 40,
    phone: [{
      home: "01948593"
    }, {
      office: "55585885"
    }]
  },
  {
    name: "kamal",
    age: 50,
    phone: [{
      home: "01989333"
    }, {
      office: "55386885"
    }]
  }
]

function NestedMapping() {
  return ( <
    div className = 'container' >




    <
    div >
    <
    div className = "cards" >
    <
    div className = "card card-one" >
    <
    h2 className = "card-title" > sdf < /h2> <
    p className = "description" > < /p> <
    div >
    <
    /div>


    <
    /div> <
    /div> <
    /div>



    <
    /div>
  )
}

export default NestedMapping
